import React from "react";
import { Flag, Segment } from "semantic-ui-react";
import axios from "axios";
import { Link } from "react-router-dom";

import newspaper from "./src/newspaper.png";
import Weather from "./Weather";
import News from "./News";
import twitter from "./src/twitter.png";
import TrendYoutube from "./TrendYoutube";
import weather from "./src/weather.png";
/* import "./globalStyle.css"; */

class Cell extends React.Component {
  render() {
    return (
      <Segment>
        <Flag name={this.props.code} />
        <div id={`fuso_${this.props.code}`} />
        <h5>{this.props.name}</h5>
        <div className="row">
          <News />
          <Weather />
          <img
            id="twitter_ca"
            /* onClick="twitter(45.376296, -75.651582)" */
            className="api_icon"
            src={twitter}
            alt="icon_twitter"
          />
          <TrendYoutube />
          <Link to="/global/weather/:country">
            <img src={weather} />
          </Link>
        </div>
      </Segment>
    );
  }
}

export default Cell;
